    readProduct,
    createProduct,
    deleteProduct,
    updateProduct,
    readProductList,
} from './ctrl/product.ctrl';

const routes = [
    {
        method: 'GET',
        url: '/post',
        handler: readProductList,
    },
    {
        method: 'POST',
        url: '/post/create',
        handler: createProduct,
    },
    {
        method: 'GET',
        url: '/post/:id',
        handler: readProduct,
    },
    {
        method: 'DELETE',
        url: '/post/:id',
        handler: deleteProduct,
    },
    {
        method: 'PUT',
        url: '/post/:id',
        handler: updateProduct,
    },
];


export default routes;













