import {
    readRoom,
    createRoom,
    deleteRoom,
    updateRoom,
    readRoomList,
    reportRoom,
} from './ctrl/room.ctrl';
import { createRoomSchema } from './schema/roomSchema';

const routes = [
    {
        method: 'GET',
        url: '/rooms',
        handler: readRoomList,
    },
    {
        method: 'POST',
        url: '/room/create',
