import mongoose from 'mongoose';
// import autoIncrement from 'mongoose-auto-increment';

const RoomSchema = new mongoose.Schema({
    id: {
        type: Number,
        unique: true,
    },
    name: {
        type: String,
        required: true,
    },
    roomType: {
        type: Number,
        required: true,
    },
    deposit: {
        type: Number,
    },
    monthlyPayment: {
        type: Number,
    },
    address: {
        type: String,
    },
    registLessor: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Lessor',
    },
    progress: {
        type: Number,
    },
    reported: [
        {
            // reportLessee: {
            //     type: mongoose.Schema.Types.ObjectId,
            //     ref: 'Lessee',
            // },
            reason: {
                type: String,
            },
        }
    ],

    // 필터링용 DB
    area: {
        type: String,
    },
    nearStation: [
        {
            name: {
                type: String,
            },
            walkTime: {
                type: Number,
            },
        }
    ],
    review: [
        {
            auth: {
                type: mongoose.Schema.Types.ObjectId,
